import React from 'react';

const EmailList = ({ key, campId, listName, file }) => {
    return (
        <div className="content">
            <div className="campName">
                {listName}
            </div>
            <div className="loadButtonHolder">
                <div className="loadButton"
                    onClick={() => {
                        null
                    }}
                >
                    Load
                </div>
            </div>
        </div>
    );
}

export default EmailList;
